public class KnowledgeBaseFactory(string resourceName = null, Action<Humidifier.Wisdom.KnowledgeBase> factoryAction = null) : ResourceFactory<Humidifier.Wisdom.KnowledgeBase>(resourceName)
{

    internal InnerKnowledgeBaseSourceConfigurationFactory SourceConfigurationFactory { get; set; }

    internal InnerKnowledgeBaseServerSideEncryptionConfigurationFactory ServerSideEncryptionConfigurationFactory { get; set; }

    internal InnerKnowledgeBaseRenderingConfigurationFactory RenderingConfigurationFactory { get; set; }

    protected override Humidifier.Wisdom.KnowledgeBase Create()
    {
        var knowledgeBaseResult = CreateKnowledgeBase();
        factoryAction?.Invoke(knowledgeBaseResult);

        return knowledgeBaseResult;
    }

    private Humidifier.Wisdom.KnowledgeBase CreateKnowledgeBase()
    {
        var knowledgeBaseResult = new Humidifier.Wisdom.KnowledgeBase
        {
            GivenName = InputResourceName,
        };

        return knowledgeBaseResult;
    }
    public override void CreateChildren(Humidifier.Wisdom.KnowledgeBase result)
    {
        base.CreateChildren(result);

        result.SourceConfiguration ??= SourceConfigurationFactory?.Build();
        result.ServerSideEncryptionConfiguration ??= ServerSideEncryptionConfigurationFactory?.Build();
        result.RenderingConfiguration ??= RenderingConfigurationFactory?.Build();
    }

} // End Of Class

